values:
wow, that was THE dorkiest movie I have EVER seen. Holy FUCK.

we have this word for when character's in movies get overly emotional towards each other in that super cheesy doofy way, the word is dardley dar [dar dl ee dar],. As in "awwwww, Wesley Crusher, Captain Picard dardley dar. It was actually invented because of Star Trek the next gen, btw.&nbsp; 

Eragon was a parade of one dardley dar moment after another. I'm pretty sure I actually have played that 'campaign' in a pen and paper RPG more than once. Books that get turned into movies should not be written by people who still LARP at age 35.
